import React from 'react';
import './QuestionBoxItem.css';

const questionBoxItem = props =>{
    return(
        <div className='QuestionBoxHeader'>
            <div>
                <span style={{fontWeight:'bolder'}}>Usuário:</span> {props.user}
            </div> <br/>
            <div>
                <span style={{fontWeight:'bolder'}}>Número de respostas:</span> {props.answers}
            </div> <br/>
            <div className='QuestionBoxParagraph'>
                <span style={{fontWeight:'bolder', marginBottom:'10px'}}>Pergunta:</span><br/><br/>
                {props.text}
            </div>

        </div>
    );
};

export default questionBoxItem;
